mutation CreateCompany($name: String!) {
  createCompany(name: $name) {
    __typename
    id
    name
  }
}

dd83b02133c9e308f07b25b35fb25413a78b49d1.source:
query ArtistDetails($id: ID!) {
  artist(id: $id) {
    __typename
    ... on Soloist {
      ...SoloistDetails
      groups {
        __typename
        displayName
        secondaryDisplayName
        images {
          __typename
          cardFlat
        }
      }
    }
    ... on Group {
      ...GroupDetails
      members {
        __typename
        displayName
        images {
          __typename
          icon
        }
      }
    }
  }
}
